import React from "react";
import { VictoryLabel, VictoryPie, VictoryChart, VictoryTheme } from "victory";

function Points() {
  return(
    <VictoryChart
      theme={VictoryTheme.material}
      domainPadding={400}
      width = {900}
    >
      <VictoryLabel x={25} y={24} style={styles.title}
        text="Total Points"
      />
      <VictoryPie
        data={[
          { x: "Completed", y: 35 },
          { x: "Not Completed", y: 40 },
        ]}
      />

    </VictoryChart>
  );

}
export default Points;
